INSERT [Lis1].[dbo].[inf_obj_DISTANCE] (node1_cod, node1_id, node1_name, node2_cod, node2_id, node2_name, distance)
select t.node1_cod, U.node1_id, U.node1_name, t.node2_cod, K.node2_id, K.node2_name, distance,  as node2_name 
from #tmp t
OUTER APPLY (SELECT TOP 1 inf_obj_id as node1_id, inf_obj_name as node1_name FROM inf_obj_NODE WHERE inf_obj_cod = t.node1_cod COLLATE SQL_Latin1_General_CP1251_CI_AS AND getdate() BETWEEN date_begin AND date_end) U
OUTER APPLY (SELECT TOP 1 inf_obj_id as node2_id, inf_obj_name as node2_name FROM inf_obj_NODE WHERE inf_obj_cod = t.node2_cod COLLATE SQL_Latin1_General_CP1251_CI_AS AND getdate() BETWEEN date_begin AND date_end) K

--select * from inf_obj_NODE



